import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {

    const closeHiddenMenu = (event) => {
        event.target.parentElement.style.display = "none";
    }

    return (
        <nav className="navbar navbar-expand-md navbar-dark bg-secondary px-2">
        <a className="navbar-brand" href="https://redux.js.org" target="_blank" rel="noreferrer">Redux</a>

        <button className="navbar-toggler" data-bs-toggle="collapse" data-bs-target="#hidden-menu">
              <span className="navbar-toggler-icon"></span>
        </button>

        <div className="offcanvas offcanvas-start bg-secondary" id="hidden-menu">
            <a className="btn-close d-md-none ms-auto me-2 mt-2 fs-5" data-bs-dismiss="offcanvas"
            onClick={(event) => closeHiddenMenu(event)}></a>
            <div className="offcanvas-body flex-md-row align-items-center ms-3">
                <ul className="navbar-nav">
                    <li><a className="nav-link"><Link to="/shop" style={{color : "white" , textDecoration : "none"}}>Shop</Link></a></li>
                    <li><a className="nav-link"><Link to="/users" style={{color : "white" , textDecoration : "none"}}>Users</Link></a></li>
                </ul>
            </div>
       </div>
</nav>
    );
}

export default Navbar;
